DO
$do$
DECLARE
  _counter int := 0;
-- LOOP
begin
  WHILE (exists (select 1 from basico_regra where regra like raca_id||'/%')) 
  loop
    _counter := _counter + 1;
    RAISE NOTICE 'The counter is %', _counter;  -- coerced to text automatically
    
    -- 1 - AAA/BBB/CCC/DDD n -> Insert BBB
    insert into basico_regra(raca_id,regra,descricao)
    --select split_part(split_part(regra,'/',2),' ',1),replace(regra,left(regra,position(' ' in  regra)),''), descricao from basico_regra
    --where regra like '%/%';
    select substring(regra,5,3), replace(regra,left(regra,position(' ' in  regra)),''), descricao from basico_regra
    where regra like raca_id||'/%'
    --and raca_id='ACL'
    ;
    
    -- 2 - Acerta os que começam pela mesma descrição que reca_id
    --select substring(regra,5,1000),substring(regra,9,1000),raca_id||substring(regra,8,1000),* from basico_regra
    update basico_regra set regra=raca_id||substring(regra,8,1000)
    where regra like raca_id||'/%'
    --and raca_id='ACL'
    ;
    
  end loop;
END
$do$
;

-- 3 - Acerta os que começam com raça
--select substring(regra,5,1000),* from basico_regra
update basico_regra set regra=substring(regra,5,1000)
where left(regra,3) = raca_id;

select * from basico_regra 
--where raca_id='DRX'
